(def words-file (slurp "data/words"))

(def words (s/split words-file #"\r\n"))

(def vowels #{\a \A \e \E \i \I \o \O \u \U})

(defn filter-vowels 
  [w] 
  (apply str 
         (filter vowels w)))

(defn remove-vowels 
  [w] 
  (apply str 
         (remove vowels w)))

(defn lower [s] (.toLowerCase s))

(defn w2cf 
  [w] 
  (frequencies (sort (map #((comp keyword lower str) %) (seq w)))))
