(comment (:inserted
  (run conn
     [[:table "words1"]
      [:insert (map #(assoc {} 
                            :word % 
				            :length (count %)
                            :vowels (filter-vowels %)
                            :vcount (count (filter-vowels %))
                            :consonants (remove-vowels %)
                            :ccount (count (remove-vowels %))
				            :freq (w2cf %)
                            :vfreq (w2cf (filter-vowels %))
                            :cfreq (w2cf (remove-vowels %)))
				    (take 50000 
                          (drop 200000 
                                words)))]])))
